import React, { useEffect, useState } from "react";
import { getTeams } from "../../api/api";
export default function Teams() {
  const [teams, setTeams] = useState({
    team: {}
  });

  useEffect(() => {
    getTeams()
      .then(res => {
        return res.json();
      })
      .then(data => {
        setTeams({ team: data.data });
      })
      .catch(error => console.error(error));
  }, []);
